#!/usr/bin/env python3 


### Is this a set or not?
mySet = set('ATGTGGG') # returns unique elements, is an actual set which removes duplicates
mySet2 = {'ATGTGGG'} # returns one  element / string, does not remove duplicates
mySet3 = set([1,2,3,4,1])

print(mySet)
print(mySet2)
print(mySet3)

### Create two sets
### Find intersection, difference, union, and symmtrical difference

my_set1 = set([3, 14, 15, 9, 26, 5, 35, 9])
my_set2 = set([60, 22, 14, 0, 9])
print(my_set1)
print(my_set2)

# Difference
diff = my_set1 - my_set2
print(f'The difference between the sets is: {diff}')
# Intersection
inter = my_set1 & my_set2
print(f'The intersection between the sets is: {inter}')
# Union
union = my_set1 | my_set2
print(f'The union between the sets is: {union}')
# Symmetrical difference
diff_sym = my_set1 ^ my_set2
print(f'The symmetrical difference between the sets is: {diff_sym}')

### Create a set of a DNA sequence
dna_set = set("")
print(dna_set) # returns the unique nucleotides